import React from "react";

function Header (){
    return (
        <header>
            <ul>
                <li>1</li>
                <li>2</li>
            </ul>
            <img
                src="https://www.logolynx.com/images/logolynx/bd/bdb4767220c29c67a6a332864b8ecaa1.jpeg"
                alt="Meme"
            />
            <p>A Meme Generator</p>
        </header>
    )
}

export default Header;
